import React from 'react'
import './ChimpTest.css';

export default function ChimpTest() {
  return (
    <>
    <header className="header">
      <h1 className="header-title">Chimp Test</h1>
      <nav className="header-nav">
        <a href="#about">Monkey Information</a>
        {/* <a href="#services">Services</a>
        <a href="#contact">Contact</a> */}
      </nav>
    </header>
    <div className="title">
        Monkey
    </div>
    <buttonGroup className= "numbers" >
      <button>1</button>
      <button>2</button>
      <button>3</button>
      <button>4</button>
      <button>5</button>
    </buttonGroup>
    <script>
      const button = document.querySelector("button");
      const randomLeftValue = Number.parseInt(Math.random() * (1000 - 10) + 10);
      const randomTopValue =  Number.parseInt(Math.random() * (1000 - 10) + 10);
      button.style.top = `${randomLeftValue}px`;
      button.style.left = `${randomTopValue}px`;
    </script>
    </>
  )
}
